import React, { Component } from 'react';

var Yama = {
  'name':'Brahmacharia',
  'meaning':'Restraint',
  'blog': `Brahmacharia is`
}
class Yama4 extends Component {
    render() {

      return (
        <div className="blogContainer">
          <p className="blog">{Yama.name}
          </p>
        </div>
      );
    }
  }

export default Yama4;
